import React from "react";

const Home = () => {
  return (
    <div className="max-w-4xl mx-auto p-8 text-center">
      <h1 className="text-5xl font-extrabold mb-6 text-indigo-700">
        Welcome to DJ Blue's Official Website
      </h1>
      <p className="text-lg text-gray-700 mb-4">
        Experience the ultimate sound journey with DJ Blue. Mixing the best
        beats from around the world to keep your party alive all night long.
      </p>
      <p className="text-gray-600 leading-relaxed">
        Whether it's an intimate gathering or a massive festival, DJ Blue
        brings energy, rhythm, and an unforgettable vibe. Join the movement
        and feel the music pulse through your soul.
      </p>
    </div>
  );
};

export default Home;
